@Fire_Up_The_67 Her eyes widen as her fiery irises flash towards him. Fuck, she didn't expect new company... ..damn it.

Her face grew a warm shade of maroon as she slowly lowers to the ground, almost ready to use her powers to wipe his memory. 

"Oh hey I suppose. My bad."

